import './kb.scss';
import Keyboard from "./keyboard";

export default function BKey() {    
    function keyPress(note) {
        alert("keypress note: " + note);
    }
    return (      
        <div className='b-key' onClick={() => keyPress('F')}>
        </div>
    );
}
